    props.alert &&<div className={`alert alert-$ alert-dismissible fade show`} role="alert">
   <strong>{props.alert.type}</strong>: {props.alert.msg}
    <button type="button" className="btn btn-close btn-danger" data-bs-dismiss="alert" aria-label="Close"></button>
  </div>
  )
}
